	/**
     * TODO:将byte数组以Base64方式编码为字符串
     * @param bytes 待编码的byte数组
     * @return 编码后的字符�?
     * */
    public static String encode(byte[] bytes){
        return new BASE64Encoder().encode(bytes);
    }
    
    /**
     * TODO:将以Base64方式编码的字符串解码为byte数组
     * @param encodeStr 待解码的字符�?
     * @return 解码后的byte数组
     * @throws IOException 
     * */
    public static byte[] decode(String encodeStr) throws IOException{
        byte[] bt = null;  
        BASE64Decoder decoder = new BASE64Decoder();  
        bt = decoder.decodeBuffer(encodeStr);
        return bt;
    }
    
    /**
     * TODO:将两个byte数组连接起来后，返回连接后的Byte数组
     * @param front 拼接后在前面的数�?
     * @param after 拼接后在后面的数�?
     * @return 拼接后的数组
     * */
    public static byte[] connectBytes(byte[] front, byte[] after){
        byte[] result = new byte[front.length + after.length];
        System.arraycopy(front, 0, result, 0, after.length);
        System.arraycopy(after, 0, result, front.length, after.length);
        return result;
    }
    
    /**
     * TODO:将图片以Base64方式编码为字符串
     * @param imgUrl 图片的绝对路径（例如：D:\\jsontest\\abc.jpg�?
     * @return 编码后的字符�?
     * @throws IOException 
     * */
    public static String encodeImage(String imgUrl) throws IOException{
        FileInputStream fis = new FileInputStream(imgUrl);
        byte[] rs = new byte[fis.available()];
        fis.read(rs);
        fis.close();
        return encode(rs);
    }
    
    /** 
     * 根据byte数组，生成文�?
     */  
    public static void getFile(byte[] bfile, String filePath,String fileName) {  
        BufferedOutputStream bos = null;  
        FileOutputStream fos = null;  
        File file = null;  
        try {  
            File dir = new File(filePath);  
            if(!dir.exists()&&dir.isDirectory()){//判断文件目录是否存在  
                dir.mkdirs();  
            }  
            file = new File(filePath+"\\"+fileName);  
            fos = new FileOutputStream(file);  
            bos = new BufferedOutputStream(fos);  
            bos.write(bfile);  
        } catch (Exception e) {  
            e.printStackTrace();  
        } finally {  
            if (bos != null) {  
                try {  
                    bos.close();  
                } catch (IOException e1) {  
                    e1.printStackTrace();  
                }  
            }  
            if (fos != null) {  
                try {  
                    fos.close();  
                } catch (IOException e1) {  
                    e1.printStackTrace();  
                }  
            }  
        }  
    }  
    
    /**
     * 图片压缩
     * @throws IOException 
     */
    public static void  zoomImageScale(File imageFile,String newPath,int newWidth) throws IOException{
    	if(!imageFile.canRead())
    		return;
    	BufferedImage bufferedImage=ImageIO.read(imageFile);
    	if(null==bufferedImage)
    		return ;
    	int originalWidth=bufferedImage.getWidth();
    	int origunalHeight=bufferedImage.getHeight();
    	double scale=(double)originalWidth/(double)newWidth;  //获得缩放比例
    	
    	int newHeight=(int)(origunalHeight/scale);  //获取新高�?
    	
    	zoomImageUtils(imageFile, newPath, bufferedImage, newWidth, newHeight);
    }
    
    private static void zoomImageUtils(File imageFile, String newPath,
			BufferedImage bufferedImage, int width, int height) throws IOException {
		// TODO Auto-generated method stub
		String suffix=StringUtils.substringAfterLast(imageFile.getName(), ".");
		
		//处理png背景变黑的问�?
		if(suffix!=null&&(suffix.trim().toLowerCase().endsWith("png")||suffix.trim().toLowerCase().endsWith("gif"))){
			BufferedImage to= new BufferedImage(width, height, BufferedImage.TYPE_INT_RGB); 
            Graphics2D g2d = to.createGraphics(); 
            to = g2d.getDeviceConfiguration().createCompatibleImage(width, height, Transparency.TRANSLUCENT); 
            g2d.dispose(); 
            
            g2d = to.createGraphics(); 
            Image from = bufferedImage.getScaledInstance(width, height, Image.SCALE_AREA_AVERAGING); 
            g2d.drawImage(from, 0, 0, null);
            g2d.dispose(); 
            
            ImageIO.write(to, suffix, new File(newPath));
		}else{
            // 高质量压缩，其实对清晰度而言没有太多的帮�?
//          BufferedImage tag = new BufferedImage(width, height, BufferedImage.TYPE_INT_RGB);
//          tag.getGraphics().drawImage(bufferedImage, 0, 0, width, height, null);
//
//          FileOutputStream out = new FileOutputStream(newPath);    // 将图片写�?newPath
//          JPEGImageEncoder encoder = JPEGCodec.createJPEGEncoder(out);
//          JPEGEncodeParam jep = JPEGCodec.getDefaultJPEGEncodeParam(tag);
//          jep.setQuality(1f, true);    //压缩质量, 1 是最高�?
//          encoder.encode(tag, jep);
//          out.close();
          
          BufferedImage newImage = new BufferedImage(width, height, bufferedImage.getType());
          Graphics g = newImage.getGraphics();
          g.drawImage(bufferedImage, 0, 0, width, height, null);
          g.dispose();
          ImageIO.write(newImage, suffix, new File(newPath));
      }
	}

    
    /**
     * 按尺寸缩放图�?
     * 
     * @param imageFile
     * @param newPath
     * @param times
     * @throws IOException
     */
    public static void zoomImage(File imageFile, String newPath, int width, int height) throws IOException {
        if (imageFile != null && !imageFile.canRead())
            return;
        BufferedImage bufferedImage = ImageIO.read(imageFile);
        if (null == bufferedImage) 
            return;

        zoomImageUtils(imageFile, newPath, bufferedImage, width, height);
    }
